// --- Levenshtein distance (edit distance) ---
function levenshtein(a, b) {
  if (!a || !b) return Infinity;
  if (a.length === 0) return b.length;
  if (b.length === 0) return a.length;
  const matrix = [];

  for (let i = 0; i <= b.length; i++) {
    matrix[i] = [i];
  }
  for (let j = 0; j <= a.length; j++) {
    matrix[0][j] = j;
  }

  for (let i = 1; i <= b.length; i++) {
    for (let j = 1; j <= a.length; j++) {
      if (b.charAt(i - 1).toLowerCase() === a.charAt(j - 1).toLowerCase()) {
        matrix[i][j] = matrix[i - 1][j - 1];
      } else {
        matrix[i][j] = Math.min(
          matrix[i - 1][j - 1] + 1, // substitution
          matrix[i][j - 1] + 1,     // insertion
          matrix[i - 1][j] + 1      // deletion
        );
      }
    }
  }

  return matrix[b.length][a.length];
}

// --- Normalize strings ---
function normalize(str) {
  return String(str || "")
    .toLowerCase()
    .trim()
    .replace(/\s+/g, " ");
}

// --- MAIN LOGIC ---

// 1. Get company from form
const inputCompany = $('On form submission1').first().json['Client Company Name - as it appears in Notion'];
if (!inputCompany) {
  throw new Error('Form did not provide a company name');
}
const normInput = normalize(inputCompany);

// 2. Get transcript from form
const transcript = $('On form submission1').first().json['Transcript - Full Transcript Copied From Fathom'] || "";

// 3. Get dataset
const dataSet = $input.first().json.data;
if (!Array.isArray(dataSet)) {
  throw new Error('Dataset not found or not an array at $input.first().json.data');
}

// 4. Exact match
let match = dataSet.find(row =>
  normalize(row['Company as in Notion']) === normInput
);

// 5. Partial match
if (!match) {
  match = dataSet.find(row => {
    const normRow = normalize(row['Company as in Notion']);
    return normRow.includes(normInput) || normInput.includes(normRow);
  });
}

// 6. Fuzzy match (Levenshtein distance, forgiving threshold)
if (!match) {
  let bestRow = null;
  let bestScore = Infinity;
  for (const row of dataSet) {
    const normRow = normalize(row['Company as in Notion']);
    if (!normRow) continue;
    const score = levenshtein(normInput, normRow);
    if (score < bestScore) {
      bestScore = score;
      bestRow = row;
    }
  }
  // More forgiving: allow up to 5 edits
  if (bestScore <= 5) {
    match = bestRow;
  }
}

// 7. Output
if (match) {
  return [{
    json: {
      ...match,
      transcript
    }
  }];
} else {
  return [{
    json: {
      type: 'company_not_found',
      inputCompany,
      transcript,
      candidates_preview: dataSet.slice(0, 10).map(r => r['Company as in Notion'])
    }
  }];
}

